import React,{useState} from "react";
import axios from 'axios';

import { useForm } from "react-hook-form";

const Login =(props)=>{
    const username = useForm('');
    const password = useForm('');
    const [error, setError] = useState(null);

   const handlesubmit=()=>{
    
        axios.post('http://localhost:8080/hospitalApp/welcome/login', { 
            userName: username.value,
             password: password.value 
            }).then(response => {
          
          console.log("res",response);
          if(response.data.message==="SUCCESS")
          props.history.push('/Home');
          else
         setError("Something went wrong. Please try again later.");
        }).catch(error => {

         setError("Something went wrong. Please try again later.");
        });
      }
        console.log('click')
    
    return(

        <div className="container  mx-4 py-4">
            <input type="username" className="mx-2 my-2"{...username}  /><br/>
            <input type="password"className="mx-2 my-2" {...password}/><br/>
            <button onClick={handlesubmit} type="button"className="mx-5 btn btn-primary">login</button>
        </div>
        
    )
}

export default Login;
